@app.route('/api/predictedCrime', methods=['POST'])
def predict():
    try:
        json_details = request.get_json()
        loaded_ceencoder = joblib.load("ceencoder.sav")
        loaded_labelencoder = joblib.load("leencoder2.sav")
        loaded_randomforestregressor = joblib.load("randomforestregressocoder.sav")

        values = json_details["Readings"]

        crimeId = values[0]["CrimeCodeDescription"]
        month = values[0]["month"]
        week = values[0]["Week"]
        day = values[0]["Day_of_Week"]
        AreaID = values[0]["AreaID"]
        SivaAreaArray = AreaID
        time = values[0]["TimeBin"]

        parameterData = pd.DataFrame(values)

        parameterData.drop("AreaID", axis=1)

        total = 0
        arrayofValues = []
        for i in range(0, len(AreaID)):
            areaId = AreaID[i]
            parameterData["AreaID"] = areaId
            X = parameterData.iloc[:,:].values
            X[:,1] = loaded_labelencoder.transform(X[:,1])
            df_X = pd.DataFrame(X)
            df_X = loaded_ceencoder.transform(df_X)
            y = loaded_randomforestregressor.predict(df_X)
            arrayofValues.append(round(float(y)))
            total = total + float(y)

        centroids = police_request(crimeId, month, week, day, SivaAreaArray, time)

        response = jsonify(prediction=round(total), centroids = list(centroids), areaprediction = arrayofValues)

        return response




    except Exception as e:
        raise e


